INSERT INTO `product` VALUES (79,'K20 Pro',8500000,'k20.jpg','8 nhân','1920x1080','4000mah','128gb','17-6-2019 13:36:33','Được mệnh danh là flaship killer','enable','Xiaomi'),(80,'iPhone XS Max',28600000,'iphone-xs-max.jpg','Apple A12 Bionic 6 nhân','OLED, 6.5\", Super Retina','3174 mAh, có sạc nhanh','256gb','17-6-2019 13:41:22','Đặc điểm nổi bật của iPhone Xs Max 256GB\n\nTìm hiểu thêm\nBộ sản phẩm chuẩn: Hộp, Sạc, Tai nghe, Sách hướng dẫn, Cáp, Cây lấy sim\n\nSau 1 năm mong chờ, chiếc smartphone cao cấp nhất của Apple đã chính thức ra mắt mang tên iPhone Xs Max. Máy các trang bị các tính năng cao cấp nhất từ chip A12 Bionic, dàn loa đa chiều cho tới camera kép tích hợp trí tuệ nhân tạo.','enable','Apple'),(81,'Samsung Galaxy S10+',21490000,'s10.png','Exynos 9820 8 nhân 64-bit','Dynamic AMOLED, 6.4\", Quad HD+ (2K+)','4100 mAh, có sạc nhanh','128 GB','17-6-2019 13:45:30','Samsung Galaxy S10+ là một trong những chiếc smartphone được trông chờ nhiều nhất trong năm 2019 và không phụ sự kỳ vọng của mọi người thì chiếc Galaxy S thứ 10 của Samsung thực sự gây ấn tượng mạnh cho người dùng.','enable','SamSung'),(82,'Xiaomi Redmi Note 7',2700000,'xiaomi-redmi-note-7.png','Qualcomm Snapdragon 660 8 nhân','IPS LCD, 6.3\", Full HD+','4000 mAh, có sạc nhanh','64 GB','17-6-2019 13:49:16','Xiaomi Redmi Note 7 là chiếc smartphone giá rẻ mới được giới thiệu vào đầu năm 2019 với nhiều trang bị đáng giá như thiết kế notch giọt nước hay camera lên tới 48 MP.','enable','Xiaomi'),(83,'OPPO F11',7290000,'oppo.png','MediaTek Helio P70 8 nhân','LTPS LCD, 6.5\", Full HD+','4020 mAh, có sạc nhanh','64 GB','17-6-2019 13:51:30','OPPO F11 gây ấn tượng với người dùng bởi thiết kế màn hình tràn viền hình giọt nước và camera sau khủng đến 48 MP.','enable','Oppo'),(84,'Xiaomi Redmi 7',2900000,'xiaomi-redmi-7.png','Qualcomm Snapdragon 632 8 nhân 64-bit','IPS LCD, 6.26\", HD+','4000 mAh','64 GB','17-6-2019 13:53:29','Xiaomi Redmi 7 16GB đã gây được chú ý cho người dùng khi ra mắt với một cấu hình khủng nhưng lại sở hữu một mức giá \"khó tin\".','enable','Xiaomi'),(85,'Samsung Galaxy A50 64GB',6900000,'samsung-galaxy-a50.png','Qualcomm Snapdragon 632 8 nhân 64-bit','IPS LCD, 6.26\", HD+','4000 mAh','64 GB','17-6-2019 13:54:58','Samsung Galaxy A50 là chiếc smartphone tầm trung mới của Samsung trong năm 2019 với nhiều tính năng hấp dẫn, đặc biệt là có cả cảm biến vân tay dưới màn hình.','enable','SamSung'),(86,'Huawei P30 Pro',22500000,'huawei-p30-pro-1-400x460.png','Qualcomm Snapdragon 632 8 nhân 64-bit','IPS LCD, 6.26\", HD+','4000 mAh','64 GB','17-6-2019 13:56:20','Samsung Galaxy A50 là chiếc smartphone tầm trung mới của Samsung trong năm 2019 với nhiều tính năng hấp dẫn, đặc biệt là có cả cảm biến vân tay dưới màn hình.','enable','Huawei'),(87,'Huawei Y7 Pro ',1500000,'huawei-y7-pro-2019-400x460.png','8 nhân','1920x1080','4000mah','64 GB','17-6-2019 13:57:51','Hoàn toàn lột xác so với phiên bản tiền nhiệm, Y7 Pro (2019) đã giúp Huawei có thêm điểm cộng trong mắt người dùng nhờ việc đem thiết kế mặt lưng gradient, màn hình giọt nước và pin khủng lên chiếc smartphone giá rẻ của mình','enable','Huawei'),(88,'iPhone 7 Plus 32GB',12000000,'iphone-7-plus-gold-400x460.png','8 nhân','1920x1080','4000mah','64 GB','17-6-2019 13:58:55','Chiếc điện thoại sở hữu camera kép đầu tiên của Apple\niPhone 7 Plus là chiếc iPhone đầu tiên được trang bị camera kép có cùng độ phân giải 12 MP, đem lại khả năng chụp ảnh ở hai tiêu cự khác nhau.','enable','Apple'),(89,'iPhone 8 Plus 256GB',25000000,'iphone-8-plus-256gb-gold-400x460.png','8 nhân','1920x1080','4000mah','64 GB','17-6-2019 14:00:01','Chiếc điện thoại sở hữu camera kép đầu tiên của Apple\niPhone 8 Plus là chiếc iPhone đầu tiên được trang bị camera kép có cùng độ phân giải 12 MP, đem lại khả năng chụp ảnh ở hai tiêu cự khác nhau.','enable','Apple'),(90,'K20',6400000,'iphone-8-plus-256gb-gold-400x460.png','8 nhân','1920x1080','4000mah','64 GB','17-6-2019 14:01:16','Xiaomi Redmi K20 là chiếc smartphone vừa được giới thiệu gây rất nhiều chú ý với người dùng bởi nó hội tụ đủ 3 yếu tố \"ngon bổ rẻ\"','enable','Xiaomi'),(92,'K20 Pro',7555555,'iphone-xs-max.jpg','8 nhân','1920x1080','4000mah','64 GB','17-6-2019 14:29:47','xịn xò','enable','Xiaomi');
